sys_variable_value.value:
(function execute(inputs, outputs) {
    var start, urlStart;
    //https://your-domain.atlassian.net/rest/servicedeskapi/request/1000/participant?start=0&limit=1
    if(inputs.next_link){
      //outputs.next_link = start value in link
      urlStart = ((inputs.next_link).split("start="))[1];
      start = (urlStart.split("&"))[0];
      //gs.info("inside pagiantion +++"+url);
      outputs.start = start;

    }
})(inputs, outputs);

